import React from 'react';

const Settings = () => {
    return (
        <div>
            <div>
                <label>max value:<input type={'number'}/></label>
            </div>
            <div>
                <label>start value:<input type={'number'}/></label>
            </div>
        </div>
    );
};

export default Settings;
